// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Certificate {
    struct CertificateData {
        uint256 id;
        string certificateName;
        string issuedBy;
        uint256 issueDate;
        uint256 expiryDate;
        address owner;
    }

    uint256 private nextCertificateId;
    mapping(uint256 => CertificateData) private certificates;
    mapping(address => uint256[]) private ownerCertificates;

    event CertificateIssued(
        uint256 indexed id,
        string certificateName,
        string issuedBy,
        uint256 issueDate,
        uint256 expiryDate,
        address indexed owner
    );

    function issueCertificate(
        string memory certificateName,
        string memory issuedBy,
        uint256 issueDate,
        uint256 expiryDate
    ) public {
        uint256 certificateId = nextCertificateId++;
        certificates[certificateId] = CertificateData({
            id: certificateId,
            certificateName: certificateName,
            issuedBy: issuedBy,
            issueDate: issueDate,
            expiryDate: expiryDate,
            owner: msg.sender
        });
        ownerCertificates[msg.sender].push(certificateId);

        emit CertificateIssued(
            certificateId,
            certificateName,
            issuedBy,
            issueDate,
            expiryDate,
            msg.sender
        );
    }

    function getCertificate(uint256 certificateId)
        public
        view
        returns (CertificateData memory)
    {
        return certificates[certificateId];
    }

    function getCertificatesByOwner(address owner)
        public
        view
        returns (CertificateData[] memory)
    {
        uint256[] memory certificateIds = ownerCertificates[owner];
        CertificateData[] memory result = new CertificateData[](
            certificateIds.length
        );

        for (uint256 i = 0; i < certificateIds.length; i++) {
            result[i] = certificates[certificateIds[i]];
        }

        return result;
    }
}
